B7E451F2-B48B-40C6-B17E-DBE89785D826.source:
function keydown( event ) {
	if (event.key === "ArrowUp" && this.position.y <= 10) {
		this.position.y += 1;	
	}
	if (event.key === "ArrowDown" && this.position.y > 0) {
		this.position.y -= 1;	
	}
};

C7E22449-1B7F-45DF-9D7A-8B0BFF32D81C.source:
function keydown( event ) {
	if (event.key === "ArrowUp" && this.position.y <= 10) {
		this.position.y += 1;	
		if (this.position.y >= 5) {
			this.position.x -= 0.5;	
		}
	}
	if (event.key === "ArrowDown" && this.position.y > 0) {
		this.position.y -= 1;	
		if (this.position.x < 0) {
			this.position.x += 0.5;	
		}
	}
};

