52B0E7E8-E71C-4758-989F-512A1B9F2A37.source:
var keyLocation = 0;

function keydown( event ) {
	if (event.key === "ArrowUp") {
		keyLocation += 1;

		if (keyLocation >= 5 && this.position.y < 5) {
			this.position.y += 1;		
		}
	}
	if (event.key === "ArrowDown") {
		keyLocation -= 1;

		if (keyLocation >= 0 && this.position.y > 0) {
			this.position.y -= 1;		
		}
	}
};

