1D092D85-96CC-4281-A508-BE04E8D4FAF5.source:
var keyLocation = 0;

function keydown( event ) {
	if (event.key === "ArrowUp") {
		keyLocation += 1;

		if (keyLocation >= 10 && this.position.x < 5) {
			this.position.x += 1;
			this.position.z -= 1;
		}
	}
	if (event.key === "ArrowDown") {
		keyLocation -= 1;

		if (keyLocation >= 0 && this.position.x > 0) {
			this.position.x -= 1;
			this.position.z += 1;		
		}
	}
};

