6BC92E40-0C4E-40C4-96F3-C225451239F4.source:
function keydown( event ) {
	if (event.key === "ArrowLeft") {
		this.rotation.y -= 0.1;	
	}
	if (event.key === "ArrowRight") {
		this.rotation.y += 0.1;	
	}
}
